  false,\n\t\"url\": null,\n\t\"notes\": \"New Orleans voting precincts are drawn
  according to the New Orleans Home Rule Charter as required by the State of Louisiana.
  A precinct is defined in the state of Louisiana's election code as the smallest
  political unit of a ward having defined geographical boundaries. Precinct boundaries
  were updated September 25, 2015, in order to satisfy population changes discovered
  by the Orleans Registrar of Voters Office. The changes have been made by the City
  of New Orleans and verified by the Louisiana Secretary of State's Office.\",\n\t\"license_title\":
